import React, { useState } from 'react';
import styles from './styles.css';
import Card from '../card/';
export default props => {
  const [number, setNumber] = useState(0);
  const [cards, setCards] = useState([]);
  return (
    <button
      onClick={() => {
        setNumber(number + 1);
        setCards([...cards]);
      }}
      className="button"
    >
      Generate
    </button>
  );
};
